I was honored to be sponsored by @wildbonesofficial for the last 2 years. Unfortunately, all good things must come to an end and @wildbonesofficial is no more. (Although you can still purchase until the end of this month 😉). Personally, I will be going back to my #bigfootsliders from @bigfoot_bike_skate. These are over 2 years old, but only a few months worth of slides under them. First thing I noticed is how much lighter they are! I’m excited to try these out on all surfaces now that I have 2 more years of skating and slide experience 🙌🏼
